        Freedom &amp; individuality, NU`EST's battle-cry to reach your dreams\r\n\
        \"Show them who you really are!!!\"\r\n\
        \r\n\
        After their explosive debut in March 2012, NU'EST emerged as a 'new style icon' in the world of K-pop, fueled by the five members' uniquely individual personas and dazzling visual impact. And with their first mini album, Urban Electro Band NU'EST took a stand and stuck close by their fans by bringing the social issue of school violence and bullying to the forefront.\r\n\
        \r\n\
        With a strong fan base already attained, NU`EST has created its own unique stylish and sophisticated style unlike the usual K-pop fare. Building on the message of the first album, NU`EST again takes the role of youth representative, reinterpreting today's social issues from the perspective of teens. The issue they address this time is conformity, and the limitations placed on youth who are pushed into a life of uniformity, neglecting their individuality and dreams. NU`EST is saying that you have to stand up for yourself and defend your dreams and individuality, instead of allowing yourself to be pigeonholed.\r\n\
        Get ready for the return of  NU`EST, the most promising artists of 2012, with consummate showmanship and a powerful message!!\r\n\
        This summer, too, will continue to be NU`EST's time. \r\n\
